MonoOsc1Node::MonoOsc1Node(juce::String nm)
{
  name = juce::String(nm);
  type = Mono_Osc_1_Node;
  MidiInputConnector* in = new MidiInputConnector("MidiInput", this);
  inputs[in->getName()] = in;
  MonoControlInputConnector* gate = new MonoControlInputConnector("GateInput", this);
  inputs[gate->getName()] = gate;
  MonoControlInputConnector* level = new MonoControlInputConnector("LevelInput", this);
  inputs[level->getName()] = level;
  MonoAudioInputConnector* fm = new MonoAudioInputConnector("FMInput", this);
  inputs[fm->getName()] = fm;
  MonoAudioInputConnector* ring = new MonoAudioInputConnector("RingInput", this);
  inputs[ring->getName()] = ring;
  MonoControlInputConnector* option = new MonoControlInputConnector("OptionInput", this);
  inputs[option->getName()] = option;
  MonoControlInputConnector* ratio = new MonoControlInputConnector("RatioInput", this);
  inputs[ratio->getName()] = ratio;
  MonoAudioOutputConnector* out = new MonoAudioOutputConnector("AudioOutput", this);
  outputs[out->getName()] = out;
}

void MonoOsc1Node::updateConnections()
{
  midiIn = dynamic_cast<MidiInputConnector*>(inputs["MidiInput"]);
  if (midiIn->isConnected())
  {
    midiFrom = dynamic_cast<MidiOutputConnector*>(midiIn->from);
  }
  gateIn = dynamic_cast<MonoControlInputConnector*>(inputs["GateInput"]);
  if (gateIn->isConnected())
  {
    gateFrom = dynamic_cast<MonoControlOutputConnector*>(gateIn->from);
  }
  levelIn = dynamic_cast<MonoControlInputConnector*>(inputs["LevelInput"]);
  if (levelIn->isConnected())
  {
    levelFrom = dynamic_cast<MonoControlOutputConnector*>(levelIn->from);
  }
  ratioIn = dynamic_cast<MonoControlInputConnector*>(inputs["RatioInput"]);
  if (ratioIn->isConnected())
  {
    ratioFrom = dynamic_cast<MonoControlOutputConnector*>(ratioIn->from);
  }
  fmIn = dynamic_cast<MonoAudioInputConnector*>(inputs["FMInput"]);
  if (gateIn->isConnected())
  {
    fmFrom = dynamic_cast<MonoAudioOutputConnector*>(fmIn->from);
  }
  optionIn = dynamic_cast<MonoControlInputConnector*>(inputs["OptionInput"]);
  if (optionIn->isConnected())
  {
    optionFrom = dynamic_cast<MonoControlOutputConnector*>(optionIn->from);
  }
  output = dynamic_cast<MonoAudioOutputConnector*>(outputs["AudioOutput"]);
}

float oscFunc(float x, int wavestart)
{
  auto pi2 = juce::MathConstants<float>::twoPi;
  auto fsamp = (fmod(x, pi2)  / pi2) * 2048.0f;
  auto isamp = (int) fsamp;
  auto delta = fsamp - isamp;
  isamp = (isamp % 2048) + wavestart;
  auto samp1 = wavetbl[isamp];
  auto samp2 = wavetbl[(isamp+1)];
  auto sampval = samp1 + ((samp2 - samp1) * delta);
  return sampval;
}

void MonoOsc1Node::process(int64_t ticks, int sample)
{
  if (gateIn->isConnected())
  {
    Node* fromNode = gateFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    gate = static_cast<SwitchValue*>(gateFrom->value);
    
    if (!gate->switchval)
    {
      value->sample = 0.0f;
      MonoAudioOutputConnector* output = dynamic_cast<MonoAudioOutputConnector*>(outputs["AudioOutput"]);
      output->value = value;
      ready = true;
      return;
    }
    
  }
  else
  {
    gate = defaultGate;
    return;
  }
  if (midiIn->isConnected())
  {
    Node* fromNode = midiFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    note = static_cast<MidiNoteValue*>(midiFrom->value);
  }
  else
  {
    note = defaultNote;
  }
  if (levelIn->isConnected())
  {
    Node* fromNode = levelFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    level = static_cast<ScalarValue*>(levelFrom->value);
  }
  else
  {
    level = defaultLevel;
  }
  if (fmIn->isConnected())
  {
    Node* fromNode = fmFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    fm = static_cast<AudioSampleValue*>(fmFrom->value);
  }
  else
  {
    fm = defaultFM;
  }
  if (ratioIn->isConnected())
  {
    Node* fromNode = ratioFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    ratio = static_cast<ScalarValue*>(ratioFrom->value);
  }
  else
  {
    ratio = defaultRatio;
  }
  if (optionIn->isConnected())
  {
    Node* fromNode = optionFrom->owner;
    if (!fromNode->isReady())
    {
      fromNode->process(ticks, sample);
    }
    option = static_cast<ScalarValue*>(optionFrom->value);
  }
  else
  {
    option = defaultOption;
  }
  if (gate->switchval)
  {
    auto freq = juce::MidiMessage::getMidiNoteInHertz(note->note) * ratio->val;
    auto delta = ((float) note->sample) / 48000.0f;
    auto period = 1.0f / freq;
    auto phase = (fmod(delta, period) / period) * juce::MathConstants<float>::twoPi;
    auto vel = ((float) note->vel) / 127.0;
    auto lev = level->val;
    auto offset = ((int) option->val) * 2048;
    value->sample = lev * vel * oscFunc(phase + (fm->sample * juce::MathConstants<float>::pi), offset);
  }
  else
  {
    value->sample = 0.0f;
  }
  output->value = value;
  ready = true;

}